description:
Thunderbolts - The Conquest of the Reich

War Documentary hosted by Greg Stebner, published by History Channel in 2001 - English narration


Information
------------------------------

Story of a P-47 Thunderbolt unit of the 362nd Fighter Group, filmed in color during the last days of World War II as requested by &quot;Hap&quot; Arnold. Features pilots of the 362nd FG through color footage from March 1945 through the end of the war. Unvarnished and uncompromising, this color film - shot from remote cameras on the planes themselves and specially-equipped bombers following the strike teams - is an extraordinary documentary of the air war over Europe. Includes never-before-seen footage, modern narrations and interviews with the pilots.

